I have loved reading your stories of resilience so far, and there is still time to submit! Small actions often have big impacts, so we’d love to hear how your creativity and tenacity have lifted up 2020!

@usskiteam’s virtual meet-and-greet will be tomorrow, Thursday Nov. 12, at 4:30 P.M. MT, so send in your submissions ASAP!

Submit your entry by posting your story on Instagram and tagging both @usskiteam and @coppermtn or email them at socialmedia@coppercolorado.com. You can also submit by sharing your story in the comments below! #keeptheflamealive
